import React from 'react';
import ReactDOM from 'react-dom/client';
import Button from 'react-bootstrap/Button'

import 'bootstrap/dist/css/bootstrap.min.css';
import './index.css';


function CreateRoomButton (props) {
	return (
                <div className= "index-btn create-room-btn">
                        <Button variant="outline-primary" size="lg">Create Room</Button>{' '}
                </div>
        );
}

function JoinRoomButton (props) {
	return (
                <div className= "index-btn join-room-btn">
                        <Button variant="outline-success" size="lg">Join Room</Button>{' '}
                </div>
        );    
}




function App() {
	return (
		<div className= "index-btns">
			<CreateRoomButton />
			<JoinRoomButton />
		</div>
	);

}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App />);
